import React from 'react';

    const ImageList = (props) => {
        const imgs = props.foundImages.map(img => {
            return <img key={img.id} src={img.urls.regular} alt={img.alt_description}></img>
        });

        const descriptions = props.foundImages.map(img => {
            console.log(img.alt_description);
            return <p>{img.alt_description}</p>
        });

        return (
            <div>
                {descriptions}
                {imgs}
            </div>
        )
    }

    export default ImageList;
